import React from 'react'
import AwesomeSlider from 'react-awesome-slider';
import AwesomeSliderStyles from 'react-awesome-slider/src/styled/fold-out-animation/index';
import homeImage from "../../Media/homeScreen.JPG";


const Slider =() =>{
    return (
  <AwesomeSlider cssModule={AwesomeSliderStyles}>
    <div data-src={homeImage} />
    <div data-src="/path/to/image-1.jpg" />
    <div data-src="/path/to/image-2.jpg" />
    <div data-src="/path/to/image-3.jpg" />
  </AwesomeSlider>
)
    };
export default Slider;
